const response = JSON.parse(insomnia.response.body);
const accessToken = response.access_token;

if (accessToken) {
  insomnia.environment.set("accessToken", accessToken);
} else {
  throw new Error("Access token not found in the response");
}

// Retrieve the raw response text
let responseText = insomnia.response.text();

// Attempt to parse the response as an integer
let resumeId = parseInt(responseText, 10);

insomnia.test("Status code is 200", function () {
    insomnia.response.to.have.status(200);
});

// Test to ensure the response is a valid integer ID
insomnia.test("Response should be a valid resume ID", function () {
    insomnia.expect(resumeId).to.be.a('number');
    insomnia.expect(resumeId).to.be.above(0); // Assuming IDs are positive integers
});

// If the resumeId is valid, set it as an environment variable
if (!isNaN(resumeId) && resumeId > 0) {
    insomnia.environment.set("resumeId", resumeId);
    console.log("New resumeId set to:", resumeId);
}

// Retrieve the resumeId from the environment variables
const resumeId = insomnia.environment.get("resumeId");

// Define the expected values
const expectedValues = {
    id: parseInt(resumeId, 10), // Ensure the id is a number
    title: "Software Engineer",
    firstName: "John",
    lastName: "Doe"
};

// Parse the JSON response
let jsonData = insomnia.response.json();

// Check that all expected fields are present and have the correct values
insomnia.test("Response contains all expected fields with correct values", function () {
    insomnia.expect(jsonData).to.have.property("id", expectedValues.id);
    insomnia.expect(jsonData).to.have.property("createdDate").that.is.a("string");
    insomnia.expect(jsonData).to.have.property("lastModifiedDate").that.is.a("string");

    for (const [key, value] of Object.entries(expectedValues)) {
        insomnia.expect(jsonData).to.have.property(key, value);
    }
});

